import './App.css';
import AIToolList from './components/AIToolList';

function App() {
  return (
    <div className="App">
      <nav className="navbar">
        <h1>AI Tools App</h1>
      </nav>
      <header className="App-header">
        <AIToolList />
      </header>
    </div>
  );
}

export default App;
